export default function Index() {
    const navigation = useNavigation();
    const router = useRouter();
    const [loading, setLoading] = useState(false);

    useEffect(()=>{
      (async function checkRefresh() {
        setLoading(true);
        try{
          const refreshToken = await getToken('refreshToken');
          console.log(refreshToken);
          const response = await getMyData();
          console.log(response);
          //const datasaved = await saveUserData(response);
          //console.log(datasaved);
          setLoading(false);
          if(response){
          router.push('/(tabs)' as any);
          }
        }catch(e){
          handleException(e);
          setLoading(false);
        }
      })();
    },[]);

  return (
    <SafeAreaView style={styles.container}>
      <StatusBar barStyle="dark-content" />
      
      {/* Logo and Brand */}
      <View style={styles.logoContainer}>
        <View style={styles.logo}>
    <Svg
      width={122}
      height={122}
      viewBox="0 0 122 122"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
    >
      <Path fill="url(#pattern0_8_376)" d="M0 0H122V122H0z" />
      <Defs>
        <Pattern
          id="pattern0_8_376"
          patternContentUnits="objectBoundingBox"
          width={1}
          height={1}
        >
          <Use xlinkHref="#image0_8_376" transform="scale(.00073)" />
        </Pattern>
        <Image
          id="image0_8_376"
          width={1363}
          height={1363}
          preserveAspectRatio="none"
          xlinkHref="data:image/png;base64,"
        />
      </Defs>
    </Svg>
        </View>
        <Text style={styles.brandName}>WiMi</Text>
      </View>
      
      {/* Buttons */}
      <View style={styles.buttonContainer}>
      <Button title="Log In" onPress={() => navigation.navigate("login")} style={styles.loginButton}
              loading={loading}
              variant="gradient"
              gradientColors={['#5858E8', '#9B5EFC']}  />


        <Button title="Sign Up" onPress={() => navigation.navigate("register")} 
              loading={loading}
              variant="outline"
              borderColor="#5858E8"
              customTextColor="#5858E8" />
      </View>
    </SafeAreaView>
  );
}

